import React from 'react'
import { Link } from 'react-router-dom'

const ComponentB = (props) => {
    const backPage = () => {
        props.history.push('/')
    }
    return (
        <>
            <div>ComponentB</div>
            <button onClick={backPage}>ホームへ戻る</button>
            <Link to='componentc' >ComponentBへ移動</Link>
        </>
    )
}

export default ComponentB
